decode_msg_initial_request(Bin, TrUserData) ->
    dfp_read_field_def_initial_request(Bin, 0, 0,
				       id(<<>>, TrUserData),
				       id(<<>>, TrUserData), TrUserData).

dfp_read_field_def_initial_request(<<10, Rest/binary>>,
				   Z1, Z2, F@_1, F@_2, TrUserData) ->
    d_field_initial_request_broker_name(Rest, Z1, Z2, F@_1,
					F@_2, TrUserData);
dfp_read_field_def_initial_request(<<18, Rest/binary>>,
				   Z1, Z2, F@_1, F@_2, TrUserData) ->
    d_field_initial_request_broker_ver(Rest, Z1, Z2, F@_1,
				       F@_2, TrUserData);
dfp_read_field_def_initial_request(<<>>, 0, 0, F@_1,
				   F@_2, _) ->
    #{broker_name => F@_1, broker_ver => F@_2};
dfp_read_field_def_initial_request(Other, Z1, Z2, F@_1,
				   F@_2, TrUserData) ->
    dg_read_field_def_initial_request(Other, Z1, Z2, F@_1,
				      F@_2, TrUserData).

dg_read_field_def_initial_request(<<1:1, X:7,
				    Rest/binary>>,
				  N, Acc, F@_1, F@_2, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_initial_request(Rest, N + 7,
				      X bsl N + Acc, F@_1, F@_2, TrUserData);
dg_read_field_def_initial_request(<<0:1, X:7,
				    Rest/binary>>,
				  N, Acc, F@_1, F@_2, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 ->
	  d_field_initial_request_broker_name(Rest, 0, 0, F@_1,
					      F@_2, TrUserData);
      18 ->
	  d_field_initial_request_broker_ver(Rest, 0, 0, F@_1,
					     F@_2, TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_initial_request(Rest, 0, 0, F@_1, F@_2,
					    TrUserData);
	    1 ->
		skip_64_initial_request(Rest, 0, 0, F@_1, F@_2,
					TrUserData);
	    2 ->
		skip_length_delimited_initial_request(Rest, 0, 0, F@_1,
						      F@_2, TrUserData);
	    3 ->
		skip_group_initial_request(Rest, Key bsr 3, 0, F@_1,
					   F@_2, TrUserData);
	    5 ->
		skip_32_initial_request(Rest, 0, 0, F@_1, F@_2,
					TrUserData)
	  end
    end;
dg_read_field_def_initial_request(<<>>, 0, 0, F@_1,
				  F@_2, _) ->
    #{broker_name => F@_1, broker_ver => F@_2}.

d_field_initial_request_broker_name(<<1:1, X:7,
				      Rest/binary>>,
				    N, Acc, F@_1, F@_2, TrUserData)
    when N < 57 ->
    d_field_initial_request_broker_name(Rest, N + 7,
					X bsl N + Acc, F@_1, F@_2, TrUserData);
d_field_initial_request_broker_name(<<0:1, X:7,
				      Rest/binary>>,
				    N, Acc, _, F@_2, TrUserData) ->
    {NewFValue, RestF} = begin
			   Len = X bsl N + Acc,
			   <<Bytes:Len/binary, Rest2/binary>> = Rest,
			   {id(binary:copy(Bytes), TrUserData), Rest2}
			 end,
    dfp_read_field_def_initial_request(RestF, 0, 0,
				       NewFValue, F@_2, TrUserData).

d_field_initial_request_broker_ver(<<1:1, X:7,
				     Rest/binary>>,
				   N, Acc, F@_1, F@_2, TrUserData)
    when N < 57 ->
    d_field_initial_request_broker_ver(Rest, N + 7,
				       X bsl N + Acc, F@_1, F@_2, TrUserData);
d_field_initial_request_broker_ver(<<0:1, X:7,
				     Rest/binary>>,
				   N, Acc, F@_1, _, TrUserData) ->
    {NewFValue, RestF} = begin
			   Len = X bsl N + Acc,
			   <<Bytes:Len/binary, Rest2/binary>> = Rest,
			   {id(binary:copy(Bytes), TrUserData), Rest2}
			 end,
    dfp_read_field_def_initial_request(RestF, 0, 0, F@_1,
