			    F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    d_field_sub_opts_qos(Rest, Z1, Z2, F@_1, F@_2, F@_3,
			 F@_4, F@_5, TrUserData);
dfp_read_field_def_sub_opts(<<18, Rest/binary>>, Z1, Z2,
			    F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    d_field_sub_opts_share(Rest, Z1, Z2, F@_1, F@_2, F@_3,
			   F@_4, F@_5, TrUserData);
dfp_read_field_def_sub_opts(<<24, Rest/binary>>, Z1, Z2,
			    F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    d_field_sub_opts_rh(Rest, Z1, Z2, F@_1, F@_2, F@_3,
			F@_4, F@_5, TrUserData);
dfp_read_field_def_sub_opts(<<32, Rest/binary>>, Z1, Z2,
			    F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    d_field_sub_opts_rap(Rest, Z1, Z2, F@_1, F@_2, F@_3,
			 F@_4, F@_5, TrUserData);
dfp_read_field_def_sub_opts(<<40, Rest/binary>>, Z1, Z2,
			    F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    d_field_sub_opts_nl(Rest, Z1, Z2, F@_1, F@_2, F@_3,
			F@_4, F@_5, TrUserData);
dfp_read_field_def_sub_opts(<<>>, 0, 0, F@_1, F@_2,
			    F@_3, F@_4, F@_5, _) ->
    #{qos => F@_1, share => F@_2, rh => F@_3, rap => F@_4,
      nl => F@_5};
dfp_read_field_def_sub_opts(Other, Z1, Z2, F@_1, F@_2,
			    F@_3, F@_4, F@_5, TrUserData) ->
    dg_read_field_def_sub_opts(Other, Z1, Z2, F@_1, F@_2,
			       F@_3, F@_4, F@_5, TrUserData).

dg_read_field_def_sub_opts(<<1:1, X:7, Rest/binary>>, N,
			   Acc, F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_sub_opts(Rest, N + 7, X bsl N + Acc,
			       F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData);
dg_read_field_def_sub_opts(<<0:1, X:7, Rest/binary>>, N,
			   Acc, F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      8 ->
	  d_field_sub_opts_qos(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
			       F@_5, TrUserData);
      18 ->
	  d_field_sub_opts_share(Rest, 0, 0, F@_1, F@_2, F@_3,
				 F@_4, F@_5, TrUserData);
      24 ->
	  d_field_sub_opts_rh(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
			      F@_5, TrUserData);
      32 ->
	  d_field_sub_opts_rap(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
			       F@_5, TrUserData);
      40 ->
	  d_field_sub_opts_nl(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
			      F@_5, TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_sub_opts(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				     F@_5, TrUserData);
	    1 ->
		skip_64_sub_opts(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				 F@_5, TrUserData);
	    2 ->
		skip_length_delimited_sub_opts(Rest, 0, 0, F@_1, F@_2,
					       F@_3, F@_4, F@_5, TrUserData);
	    3 ->
		skip_group_sub_opts(Rest, Key bsr 3, 0, F@_1, F@_2,
				    F@_3, F@_4, F@_5, TrUserData);
	    5 ->
		skip_32_sub_opts(Rest, 0, 0, F@_1, F@_2, F@_3, F@_4,
				 F@_5, TrUserData)
	  end
    end;
dg_read_field_def_sub_opts(<<>>, 0, 0, F@_1, F@_2, F@_3,
			   F@_4, F@_5, _) ->
    #{qos => F@_1, share => F@_2, rh => F@_3, rap => F@_4,
      nl => F@_5}.

d_field_sub_opts_qos(<<1:1, X:7, Rest/binary>>, N, Acc,
		     F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 57 ->
    d_field_sub_opts_qos(Rest, N + 7, X bsl N + Acc, F@_1,
			 F@_2, F@_3, F@_4, F@_5, TrUserData);
d_field_sub_opts_qos(<<0:1, X:7, Rest/binary>>, N, Acc,
		     _, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    {NewFValue, RestF} = {id(X bsl N + Acc, TrUserData),
			  Rest},
    dfp_read_field_def_sub_opts(RestF, 0, 0, NewFValue,
				F@_2, F@_3, F@_4, F@_5, TrUserData).

d_field_sub_opts_share(<<1:1, X:7, Rest/binary>>, N,
		       Acc, F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 57 ->
    d_field_sub_opts_share(Rest, N + 7, X bsl N + Acc, F@_1,
			   F@_2, F@_3, F@_4, F@_5, TrUserData);
d_field_sub_opts_share(<<0:1, X:7, Rest/binary>>, N,
		       Acc, F@_1, _, F@_3, F@_4, F@_5, TrUserData) ->
    {NewFValue, RestF} = begin
			   Len = X bsl N + Acc,
			   <<Bytes:Len/binary, Rest2/binary>> = Rest,
			   {id(binary:copy(Bytes), TrUserData), Rest2}
			 end,
    dfp_read_field_def_sub_opts(RestF, 0, 0, F@_1,
				NewFValue, F@_3, F@_4, F@_5, TrUserData).

d_field_sub_opts_rh(<<1:1, X:7, Rest/binary>>, N, Acc,
		    F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 57 ->
    d_field_sub_opts_rh(Rest, N + 7, X bsl N + Acc, F@_1,
			F@_2, F@_3, F@_4, F@_5, TrUserData);
d_field_sub_opts_rh(<<0:1, X:7, Rest/binary>>, N, Acc,
		    F@_1, F@_2, _, F@_4, F@_5, TrUserData) ->
    {NewFValue, RestF} = {id(X bsl N + Acc, TrUserData),
			  Rest},
    dfp_read_field_def_sub_opts(RestF, 0, 0, F@_1, F@_2,
				NewFValue, F@_4, F@_5, TrUserData).

d_field_sub_opts_rap(<<1:1, X:7, Rest/binary>>, N, Acc,
		     F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 57 ->
    d_field_sub_opts_rap(Rest, N + 7, X bsl N + Acc, F@_1,
			 F@_2, F@_3, F@_4, F@_5, TrUserData);
d_field_sub_opts_rap(<<0:1, X:7, Rest/binary>>, N, Acc,
		     F@_1, F@_2, F@_3, _, F@_5, TrUserData) ->
    {NewFValue, RestF} = {id(X bsl N + Acc, TrUserData),
			  Rest},
    dfp_read_field_def_sub_opts(RestF, 0, 0, F@_1, F@_2,
				F@_3, NewFValue, F@_5, TrUserData).

d_field_sub_opts_nl(<<1:1, X:7, Rest/binary>>, N, Acc,
		    F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 57 ->
    d_field_sub_opts_nl(Rest, N + 7, X bsl N + Acc, F@_1,
			F@_2, F@_3, F@_4, F@_5, TrUserData);
d_field_sub_opts_nl(<<0:1, X:7, Rest/binary>>, N, Acc,
		    F@_1, F@_2, F@_3, F@_4, _, TrUserData) ->
    {NewFValue, RestF} = {id(X bsl N + Acc, TrUserData),
			  Rest},
    dfp_read_field_def_sub_opts(RestF, 0, 0, F@_1, F@_2,
				F@_3, F@_4, NewFValue, TrUserData).

skip_varint_sub_opts(<<1:1, _:7, Rest/binary>>, Z1, Z2,
		     F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    skip_varint_sub_opts(Rest, Z1, Z2, F@_1, F@_2, F@_3,
			 F@_4, F@_5, TrUserData);
skip_varint_sub_opts(<<0:1, _:7, Rest/binary>>, Z1, Z2,
		     F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    dfp_read_field_def_sub_opts(Rest, Z1, Z2, F@_1, F@_2,
				F@_3, F@_4, F@_5, TrUserData).

skip_length_delimited_sub_opts(<<1:1, X:7,
				 Rest/binary>>,
			       N, Acc, F@_1, F@_2, F@_3, F@_4, F@_5, TrUserData)
    when N < 57 ->
    skip_length_delimited_sub_opts(Rest, N + 7,
				   X bsl N + Acc, F@_1, F@_2, F@_3, F@_4, F@_5,
				   TrUserData);
skip_length_delimited_sub_opts(<<0:1, X:7,
				 Rest/binary>>,
			       N, Acc, F@_1, F@_2, F@_3, F@_4, F@_5,
			       TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_sub_opts(Rest2, 0, 0, F@_1, F@_2,
				F@_3, F@_4, F@_5, TrUserData).

skip_group_sub_opts(Bin, FNum, Z2, F@_1, F@_2, F@_3,
		    F@_4, F@_5, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_sub_opts(Rest, 0, Z2, F@_1, F@_2,
				F@_3, F@_4, F@_5, TrUserData).

skip_32_sub_opts(<<_:32, Rest/binary>>, Z1, Z2, F@_1,
		 F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    dfp_read_field_def_sub_opts(Rest, Z1, Z2, F@_1, F@_2,
				F@_3, F@_4, F@_5, TrUserData).

skip_64_sub_opts(<<_:64, Rest/binary>>, Z1, Z2, F@_1,
		 F@_2, F@_3, F@_4, F@_5, TrUserData) ->
    dfp_read_field_def_sub_opts(Rest, Z1, Z2, F@_1, F@_2,
				F@_3, F@_4, F@_5, TrUserData).

'd_enum_client_check_acl_request.AclReqType'(1) ->
    'PUBLISH';
'd_enum_client_check_acl_request.AclReqType'(2) ->
    'SUBSCRIBE';
'd_enum_client_check_acl_request.AclReqType'(V) -> V.

read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) ->
    merge_msgs(Prev, New, MsgName, []).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      initial_request ->
	  merge_msg_initial_request(Prev, New, TrUserData);
      initial_response ->
	  merge_msg_initial_response(Prev, New, TrUserData);
      client_connect_request ->
	  merge_msg_client_connect_request(Prev, New, TrUserData);
      client_connack_request ->
	  merge_msg_client_connack_request(Prev, New, TrUserData);
      client_connected_request ->
	  merge_msg_client_connected_request(Prev, New,
					     TrUserData);
      client_disconnected_request ->
	  merge_msg_client_disconnected_request(Prev, New,
						TrUserData);
      client_authenticate_request ->
	  merge_msg_client_authenticate_request(Prev, New,
						TrUserData);
      client_check_acl_request ->
	  merge_msg_client_check_acl_request(Prev, New,
					     TrUserData);
      client_subscribe_request ->
	  merge_msg_client_subscribe_request(Prev, New,
					     TrUserData);
      client_unsubscribe_request ->
	  merge_msg_client_unsubscribe_request(Prev, New,
					       TrUserData);
      session_created_request ->
	  merge_msg_session_created_request(Prev, New,
					    TrUserData);
      session_subscribed_request ->
	  merge_msg_session_subscribed_request(Prev, New,
					       TrUserData);
      session_unsubscribed_request ->
	  merge_msg_session_unsubscribed_request(Prev, New,
						 TrUserData);
      session_resumed_request ->
	  merge_msg_session_resumed_request(Prev, New,
					    TrUserData);
      session_discarded_request ->
	  merge_msg_session_discarded_request(Prev, New,
					      TrUserData);
      session_takeovered_request ->
	  merge_msg_session_takeovered_request(Prev, New,
					       TrUserData);
      session_terminated_request ->
	  merge_msg_session_terminated_request(Prev, New,
					       TrUserData);
      message_publish_request ->
	  merge_msg_message_publish_request(Prev, New,
					    TrUserData);
      message_response ->
	  merge_msg_message_response(Prev, New, TrUserData);
      message_delivered_request ->
	  merge_msg_message_delivered_request(Prev, New,
					      TrUserData);
      message_dropped_request ->
	  merge_msg_message_dropped_request(Prev, New,
					    TrUserData);
      message_acked_request ->
	  merge_msg_message_acked_request(Prev, New, TrUserData);
      empty_success ->
	  merge_msg_empty_success(Prev, New, TrUserData);
      bool_result ->
	  merge_msg_bool_result(Prev, New, TrUserData);
      conn_info -> merge_msg_conn_info(Prev, New, TrUserData);
      client_info ->
	  merge_msg_client_info(Prev, New, TrUserData);
      message -> merge_msg_message(Prev, New, TrUserData);
      property -> merge_msg_property(Prev, New, TrUserData);
      topic_filter ->
	  merge_msg_topic_filter(Prev, New, TrUserData);
      sub_opts -> merge_msg_sub_opts(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_initial_request/3}).
merge_msg_initial_request(PMsg, NMsg, _) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
	   {_, #{broker_name := NFbroker_name}} ->
	       S1#{broker_name => NFbroker_name};
	   {#{broker_name := PFbroker_name}, _} ->
	       S1#{broker_name => PFbroker_name};
	   _ -> S1
	 end,
    case {PMsg, NMsg} of
      {_, #{broker_ver := NFbroker_ver}} ->
	  S2#{broker_ver => NFbroker_ver};
      {#{broker_ver := PFbroker_ver}, _} ->
	  S2#{broker_ver => PFbroker_ver};
      _ -> S2
    end.

-compile({nowarn_unused_function,merge_msg_initial_response/3}).
merge_msg_initial_response(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    case {PMsg, NMsg} of
      {#{hooks := PFhooks}, #{hooks := NFhooks}} ->
	  S1#{hooks => 'erlang_++'(PFhooks, NFhooks, TrUserData)};
      {_, #{hooks := NFhooks}} -> S1#{hooks => NFhooks};
      {#{hooks := PFhooks}, _} -> S1#{hooks => PFhooks};
      {_, _} -> S1
    end.

-compile({nowarn_unused_function,merge_msg_client_connect_request/3}).
merge_msg_client_connect_request(PMsg, NMsg,
				 TrUserData) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
	   {#{conninfo := PFconninfo},
	    #{conninfo := NFconninfo}} ->
	       S1#{conninfo =>
		       merge_msg_conn_info(PFconninfo, NFconninfo,
					   TrUserData)};
	   {_, #{conninfo := NFconninfo}} ->
	       S1#{conninfo => NFconninfo};
	   {#{conninfo := PFconninfo}, _} ->
	       S1#{conninfo => PFconninfo};
	   {_, _} -> S1
	 end,
    case {PMsg, NMsg} of
      {#{props := PFprops}, #{props := NFprops}} ->
	  S2#{props => 'erlang_++'(PFprops, NFprops, TrUserData)};
      {_, #{props := NFprops}} -> S2#{props => NFprops};
      {#{props := PFprops}, _} -> S2#{props => PFprops};
      {_, _} -> S2
    end.

-compile({nowarn_unused_function,merge_msg_client_connack_request/3}).
merge_msg_client_connack_request(PMsg, NMsg,
				 TrUserData) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
	   {#{conninfo := PFconninfo},
	    #{conninfo := NFconninfo}} ->
