verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      initial_request ->
	  v_msg_initial_request(Msg, [MsgName], TrUserData);
      initial_response ->
	  v_msg_initial_response(Msg, [MsgName], TrUserData);
      client_connect_request ->
	  v_msg_client_connect_request(Msg, [MsgName],
				       TrUserData);
      client_connack_request ->
	  v_msg_client_connack_request(Msg, [MsgName],
				       TrUserData);
